"use strict";(self.webpackChunkjohnycho_dev=self.webpackChunkjohnycho_dev||[]).push([[8178],{371:s=>{s.exports=JSON.parse('{"tag":{"label":"Network","permalink":"/docs/tags/network","description":"Network tag description","allTagsPath":"/docs/tags","count":22,"items":[{"id":"db/db-cap-theorem","title":"CAP \uc815\ub9ac (= \ube0c\ub8e8\uc5b4(Brewer)\uc758 \uc815\ub9ac)","description":"CAP \uc815\ub9ac (= \ube0c\ub8e8\uc5b4(Brewer)\uc758 \uc815\ub9ac)\ub294 \ubd84\uc0b0 \ub370\uc774\ud130\ubca0\uc774\uc2a4 \uc2dc\uc2a4\ud15c\uc774 CAP \uc911 2\uac1c\uc758 \uc18d\uc131\ub9cc\uc744 \uc81c\uacf5\ud560 \uc218 \uc788\ub2e4\ub294 \uc774\ub860\uc785\ub2c8\ub2e4. CAP \uc815\ub9ac\uc5d0 \ub530\ub974\uc790\uba74, \uc77c\uad00\uc131(Consistency), \uac00\uc6a9\uc131(Availability), \ubd84\ud560 \ub0b4\uc131(Partition Tolerance) \ub4f1 3\uac00\uc9c0 \uc18d\uc131\uc744 \ubaa8\ub450 \ub9cc\uc871\ud558\ub294 \ubd84\uc0b0 \ub370\uc774\ud130\ubca0\uc774\uc2a4 \uc2dc\uc2a4\ud15c\uc740 \uc874\uc7ac\ud558\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4.","permalink":"/docs/db/db-cap-theorem"},{"id":"cs/cs-network-timeout","title":"Connection Timeout, Socket Timeout, Read Timeout\uc758 \ucc28\uc774\uc810","description":"\u2714\ufe0f Connection Timeout","permalink":"/docs/cs/cs-network-timeout"},{"id":"cs/cs-cors","title":"CORS(Cross Origin Resource Sharing)","description":"CORS(Cross Origin Resource Sharing)\ub294 \ucd9c\ucc98\uac00 \ub2e4\ub978 \uacf3\uc758 \ub9ac\uc18c\uc2a4\ub97c \uc694\uccad\ud560 \ub54c \uc811\uadfc \uad8c\ud55c\uc744 \ubd80\uc5ec\ud558\ub294 \uba54\ucee4\ub2c8\uc998\uc785\ub2c8\ub2e4. \ub9ac\uc18c\uc2a4\ub97c \uc8fc\uace0\ubc1b\ub294 \ub450 \uacf3\uc758 \ucd9c\ucc98\uac00 \ub2e4\ub974\uba74 \ucd9c\ucc98\uac00 \uad50\ucc28\ud55c\ub2e4\uace0 \ud569\ub2c8\ub2e4. \uc774\ub54c \ucd9c\ucc98\ub294 URL\ubfd0\ub9cc \uc544\ub2c8\ub77c \ud504\ub85c\ud1a0\ucf5c\uacfc \ud3ec\ud2b8\uae4c\uc9c0 \ud3ec\ud568\ub429\ub2c8\ub2e4. \ub9cc\uc57d \ud074\ub77c\uc774\uc5b8\ud2b8\uc758 \ucd9c\ucc98\uac00 \ud5c8\uc6a9\ub418\uc9c0 \uc54a\uc558\ub2e4\uba74 CORS \uc5d0\ub7ec\uac00 \ubc1c\uc0dd\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.","permalink":"/docs/cs/cs-cors"},{"id":"cs/cs-dns","title":"DNS (Domain Name System)","description":"DNS(Domain Name System) \ub294 \uc6f9\uc0ac\uc774\ud2b8\uc758 \ub3c4\uba54\uc778 \uc8fc\uc18c\ub97c IP \uc8fc\uc18c\ub85c \ubcc0\ud658\ud558\ub294 \uc2dc\uc2a4\ud15c\uc785\ub2c8\ub2e4.","permalink":"/docs/cs/cs-dns"},{"id":"cs/cs-http-https","title":"HTTP vs HTTPS","description":"\u2714\ufe0f HTTP(Hypertext Transfer Protocol)","permalink":"/docs/cs/cs-https"},{"id":"cs/cs-http-version","title":"HTTP/1.1\uacfc HTTP/2.0","description":"\u2714\ufe0f HTTP/1.1","permalink":"/docs/cs/cs-http-version"},{"id":"cs/cs-ip-address-allocation","title":"IP \uc8fc\uc18c \ud560\ub2f9 \ubc29\uc2dd","description":"\ub124\ud2b8\uc6cc\ud06c\uc5d0\uc11c \ud638\uc2a4\ud2b8\uc5d0\uac8c IP\ub97c \ud560\ub2f9\ud558\ub294 \ubc29\uc2dd\uc740 \ud06c\uac8c \uc815\uc801 \ud560\ub2f9 \ubc29\uc2dd\uacfc \ub3d9\uc801 \ud560\ub2f9 \ubc29\uc2dd\uc774 \uc874\uc7ac\ud569\ub2c8\ub2e4.","permalink":"/docs/cs/cs-ip-address-allocation"},{"id":"cs/cs-jwt","title":"JWT (Json Web Token)","description":"JWT(Json Web Token) \uc740 \ud1b5\uc2e0 \uc815\ubcf4\ub97c JSON \ud615\uc2dd\uc744 \uc0ac\uc6a9\ud558\uc5ec \uc548\uc804\ud558\uac8c \uc804\uc1a1\ud558\uae30 \uc704\ud574 \uc0ac\uc6a9\ub429\ub2c8\ub2e4. JWT\ub294 \ud1a0\ud070 \uc790\uccb4\uc5d0 \uc815\ubcf4\uac00 \ud3ec\ud568\ub418\uc5b4 \uc788\ub294 Claim \uae30\ubc18 \ud1a0\ud070\uc785\ub2c8\ub2e4. \uc77c\ubc18\uc801\uc778 \uc560\ud50c\ub9ac\ucf00\uc774\uc158\uc5d0\uc11c JWT\ub294 \uc8fc\ub85c \uc778\uc99d\uacfc \uc778\uac00\ub97c \uad6c\ud604\ud558\uae30 \uc704\ud574 \uc0ac\uc6a9\ub429\ub2c8\ub2e4. JWT\ub294 \ud5e4\ub354, \ud398\uc774\ub85c\ub4dc, \uc2dc\uadf8\ub2c8\ucc98\ub85c \uad6c\ubd84\ub429\ub2c8\ub2e4. \ud5e4\ub354\uc5d0\ub294 \ud1a0\ud070\uc758 \uc554\ud638\ud654 \uc54c\uace0\ub9ac\uc998\uc774\ub098 \ud0c0\uc785\uc744 \uac00\uc9c0\uba70, \ud398\uc774\ub85c\ub4dc\uc5d0\ub294 \ub370\uc774\ud130(\ub9cc\ub8cc\uc77c, \uc0ac\uc6a9\uc790 \uc815\ubcf4 \ub4f1)\ub97c \uac00\uc9d1\ub2c8\ub2e4. \uc2dc\uadf8\ub2c8\ucc98\ub294 \ud5e4\ub354\uc640 \ud398\uc774\ub85c\ub4dc\uac00 \ubcc0\uc870\ub418\uc9c0 \uc54a\uc558\ub294\uc9c0 \ud310\ub2e8\ud558\uae30 \uc704\ud574 \uc0ac\uc6a9\ub418\ub294\ub370\uc694. \ud5e4\ub354\uc640 \ud398\uc774\ub85c\ub4dc\ub97c \ube44\ubc00 \ud0a4\ub97c \uc0ac\uc6a9\ud558\uc5ec \ud5e4\ub354\uc5d0 \uba85\uc2dc\ub41c \uc554\ud638\ud654 \uc54c\uace0\ub9ac\uc998\uc73c\ub85c \uc554\ud638\ud654\ud558\uc5ec \uc2dc\uadf8\ub2c8\ucc98\uac00 \ub9cc\ub4e4\uc5b4\uc9d1\ub2c8\ub2e4.","permalink":"/docs/cs/cs-jwt"},{"id":"cs/cs-nat","title":"NAT (Network Address Translation)","description":"IP \uc8fc\uc18c\ub294 \uacf5\uc778 IP \uc8fc\uc18c(Public IP Address) \uc640 \uc0ac\uc124 IP \uc8fc\uc18c(Private IP Address) \uac00 \uc874\uc7ac\ud569\ub2c8\ub2e4. \uacf5\uc778 IP \uc8fc\uc18c\ub294 \uace0\uc720\ud558\uba70, \uc0ac\uc124 IP \uc8fc\uc18c\ub294 \uace0\uc720\ud558\uc9c0 \uc54a\uace0 \ud2b9\uc815 \uc0ac\uc124 \ub124\ud2b8\uc6cc\ud06c\uc5d0\uc11c\ub9cc \uc0ac\uc6a9\ub429\ub2c8\ub2e4. \uc774\ub54c, \uc0ac\uc124 \ub124\ud2b8\uc6cc\ud06c\ub294 \uc678\ubd80 \ub124\ud2b8\uc6cc\ud06c\uc5d0 \uacf5\uac1c\ub418\uc9c0 \uc54a\uc740 \ub124\ud2b8\uc6cc\ud06c\ub97c \uc758\ubbf8\ud569\ub2c8\ub2e4. \uc0ac\uc124 IP\ub294 \uc77c\ubc18\uc801\uc73c\ub85c \ub77c\uc6b0\ud130\uac00 \ud560\ub2f9\ud558\uba70, \ud560\ub2f9\ubc1b\uc740 \uc0ac\uc124 IP \uc8fc\uc18c\ub294 \uc0ac\uc124 \ub124\ud2b8\uc6cc\ud06c \uc0c1\uc5d0\uc11c\ub9cc \uc720\ud6a8\ud569\ub2c8\ub2e4.","permalink":"/docs/cs/cs-nat"},{"id":"cs/cs-prg-pattern","title":"PRG(Post/Redirect/Get) \ud328\ud134","description":"\u2714\ufe0f PRG \ud328\ud134","permalink":"/docs/cs/cs-prg-pattern"},{"id":"cs/cs-tcp-3-way-handshake","title":"TCP 3-way handshake","description":"3-way handshake","permalink":"/docs/cs/cs-tcp-3-way-handshake"},{"id":"cs/cs-uri-url-urn","title":"URI, URL, URN\uc758 \ucc28\uc774\uc810","description":"URI, URL, URN","permalink":"/docs/cs/cs-uri-url-urn"},{"id":"cs/cs-ip-addressing","title":"\ub124\ud2b8\uc6cc\ud06c IP \uc8fc\uc18c \uccb4\uacc4","description":"\u2714\ufe0f \ud074\ub798\uc2a4\ud480 \uc8fc\uc18c \uccb4\uacc4 (Classful Addressing)","permalink":"/docs/cs/cs-ip-addressing"},{"id":"cs/cs-keep-alive","title":"\ub124\ud2b8\uc6cc\ud06c Keep Alive \uc18d\uc131","description":"Keep Alive\ub294 \ub124\ud2b8\uc6cc\ud06c \ub610\ub294 \uc2dc\uc2a4\ud15c\uc5d0\uc11c \ucee4\ub125\uc158\uc744 \uc9c0\uc18d\ud574\uc11c \uc720\uc9c0\ud558\uae30 \uc704\ud574 \uc0ac\uc6a9\ub418\ub294 \uae30\uc220\uc774\ub098 \uc124\uc815\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4.","permalink":"/docs/cs/cs-keep-alive"},{"id":"cs/cs-load-balancing","title":"\ub85c\ub4dc \ubc38\ub7f0\uc2f1","description":"\ub85c\ub4dc \ubc38\ub7f0\uc2f1\uc774\ub780 \uc560\ud50c\ub9ac\ucf00\uc774\uc158\uc744 \uc9c0\uc6d0\ud558\ub294 \ub9ac\uc18c\uc2a4 \ud480\uc5d0 \ub4e4\uc5b4\uc624\ub294 \ub124\ud2b8\uc6cc\ud06c \ud2b8\ub798\ud53d(\ub4e4\uc5b4\uc624\ub294 \uc694\uccad)\uc744 \uade0\ub4f1\ud558\uac8c \ubd84\uc0b0\ud558\ub294 \uac83\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4. \uc774\ub97c \uc218\ud589\ud558\ub294 \ub85c\ub4dc \ubc38\ub7f0\uc11c\ub294 \uc560\ud50c\ub9ac\ucf00\uc774\uc158 \uc11c\ubc84 \uc55e\ub2e8\uc5d0 \uc704\uce58\ud558\uba70 \ud074\ub77c\uc774\uc5b8\ud2b8 \uc694\uccad\uc744 \uc9c0\uc2dc\ud558\uace0 \uc81c\uc5b4\ud569\ub2c8\ub2e4. \uc774\ub97c \ud1b5\ud574\uc11c \uc560\ud50c\ub9ac\ucf00\uc774\uc158\uc758 \uac00\uc6a9\uc131, \ud655\uc7a5\uc131, \ubcf4\uc548 \ubc0f \uc131\ub2a5\uc744 \ud655\ubcf4\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.","permalink":"/docs/cs/cs-load-balancing"},{"id":"cs/cs-proxy","title":"\ub9ac\ubc84\uc2a4 \ud504\ub85d\uc2dc\uc640 \ud3ec\uc6cc\ub4dc \ud504\ub85d\uc2dc\uc758 \ucc28\uc774\uc810","description":"\u2714\ufe0f \ud3ec\uc6cc\ub4dc \ud504\ub85d\uc2dc(Forward Proxy)","permalink":"/docs/cs/cs-proxy"},{"id":"cs/cs-csrf","title":"\uc0ac\uc774\ud2b8 \uac04 \uc694\uccad \uc704\uc870(Cross-site Request Forgery, CSRF) \uacf5\uaca9","description":"\uc0ac\uc774\ud2b8 \uac04 \uc694\uccad \uc704\uc870(Cross-site Request Forgery, CSRF) \uacf5\uaca9\uc740 \uc0ac\uc6a9\uc790\uac00 \uc790\uc2e0\uc758 \uc758\uc9c0\uc640 \uc0c1\uad00\uc5c6\uc774 \uacf5\uaca9\uc790\uac00 \uc758\ub3c4\ud55c \ud589\uc704\ub97c \ud2b9\uc815 \uc6f9\uc0ac\uc774\ud2b8\uc5d0 \uc694\uccad\ud558\ub3c4\ub85d \ud558\ub294 \uac83\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4.","permalink":"/docs/cs/cs-csrf"},{"id":"cs/cs-ssr-and-csr","title":"\uc11c\ubc84 \uc0ac\uc774\ub4dc \ub80c\ub354\ub9c1(SSR)\uacfc \ud074\ub77c\uc774\uc5b8\ud2b8 \uc0ac\uc774\ub4dc \ub80c\ub354\ub9c1(CSR)","description":"\u2714\ufe0f \uc11c\ubc84 \uc0ac\uc774\ub4dc \ub80c\ub354\ub9c1(SSR)","permalink":"/docs/cs/cs-ssr-and-csr"},{"id":"cs/cs-web-process","title":"\uc6f9 \ube0c\ub77c\uc6b0\uc800\uc5d0 URL \uc785\ub825\ud558\uba74 \uc77c\uc5b4\ub098\ub294 \uc77c","description":"\uc608\ub97c \ub4e4\uc5b4 \uc0ac\uc6a9\uc790\uac00 www.google.com\uc744 \uc785\ub825\ud558\uba74, \ube0c\ub77c\uc6b0\uc800\ub294 HTTP \ud504\ub85c\ud1a0\ucf5c\uc744 \uc0ac\uc6a9\ud574 \uad6c\uae00 \uc6f9 \uc11c\ubc84\uc640 \ud1b5\uc2e0\ud558\ub824\uace0 \ud569\ub2c8\ub2e4. HTTP\ub294 OSI 7\uacc4\uce35 \uc911 \uc560\ud50c\ub9ac\ucf00\uc774\uc158 \uacc4\uce35\uc5d0\uc11c \ub3d9\uc791\ud558\ub294 \ud504\ub85c\ud1a0\ucf5c\uc785\ub2c8\ub2e4.","permalink":"/docs/cs/cs-web-process"},{"id":"cs/cs-ws-vs-was","title":"\uc6f9 \uc11c\ubc84\uc640 WAS(Web Application Server)","description":"\u2714\ufe0f \uc6f9 \uc11c\ubc84 (Web Server)","permalink":"/docs/cs/cs-ws-vs-was"},{"id":"cs/cs-cdn","title":"\ucee8\ud150\uce20 \uc804\uc1a1 \ub124\ud2b8\uc6cc\ud06c (Content Delivery Network, CDN)","description":"\ucee8\ud150\uce20 \uc804\uc1a1 \ub124\ud2b8\uc6cc\ud06c(Content Delivery Network, CDN) \uc740 \uc804 \uc138\uacc4\uc5d0 \ubd84\uc0b0\ub41c \uc11c\ubc84 \ub124\ud2b8\uc6cc\ud06c\uba70, \uc0ac\uc6a9\uc790\uc640 \ubb3c\ub9ac\uc801\uc73c\ub85c \uac00\uae4c\uc6b4 \uc704\uce58\uc5d0\uc11c \uc815\uc801 \ucee8\ud150\uce20(\ud639\uc740 \ub3d9\uc801 \ucee8\ud150\uce20)\ub97c \uc81c\uacf5\ud558\uc5ec \uc11c\ubc84 \uacfc\ubd80\ud558\ub97c \ubc29\uc9c0\ud558\uace0 \ud1b5\uc2e0 \uc9c0\uc5f0\uc744 \ub2e8\ucd95\ud569\ub2c8\ub2e4. CDN\uc740 \ud1b5\uc2e0\uc5d0 \ucc38\uc5ec\ud558\ub294 \ud638\uc2a4\ud2b8 \uac04\uc5d0 \uc911\uac04 \uc11c\ubc84\ub97c \ub450\uc5b4 \uc131\ub2a5\uc744 \ud5a5\uc0c1\ud569\ub2c8\ub2e4. \ub300\ud45c\uc801\uc778 CDN \uc11c\ube44\uc2a4\ub85c\ub294 CloudFront, CloudFlare \ub4f1\uc774 \uc788\uc2b5\ub2c8\ub2e4.","permalink":"/docs/cs/cs-cdn"},{"id":"cs/cs-network-switching","title":"\ud68c\uc120 \uad50\ud658 \ubc29\uc2dd\uacfc \ud328\ud0b7 \uad50\ud658 \ubc29\uc2dd","description":"\u2714\ufe0f \ud68c\uc120 \uad50\ud658 \ubc29\uc2dd (Circuit Switching)","permalink":"/docs/cs/cs-network-switching"}],"unlisted":false}}')}}]);